schemaDefinition: |-
  CREATE VIEW dbt_cl_test.stg_orders AS  SELECT renamed.order_id, renamed.customer_id, renamed.order_date, renamed.status, renamed.cycle_name
     FROM ( SELECT source.id AS order_id, source.user_id AS customer_id, source.order_date, source.status, source.cycle_name
             FROM ( SELECT raw_orders.id, raw_orders.user_id, raw_orders.order_date, raw_orders.status, raw_orders.cycle_name
                     FROM dbt_cl_test.raw_orders) source) renamed;
